import React from "react";

function Imagen() {
  return (
    <div className="text-center my-4">
      <img
        src="/Logo111.avif"
        alt="Logo de la empresa"
        width="200"
        height="200"
        className="img-fluid rounded shadow"
      />
    </div>
  );
}

export default Imagen;
